1.schema:
syntax = "proto3";
package ru.yandex.market.soc.shtnc.shtncshotbe.everest;

import "google/protobuf/timestamp.proto";

message Shot {
  optional string id = 1;
  optional string description = 2;
  optional EShotStatus status_code = 3;
  optional string profile_id = 4;
  optional int64 ext_user_id = 5;
  optional string sku = 6;
  optional int64 model_id = 7;
  optional bool is_main = 8;
  optional bool is_banned = 9;
  optional bool is_whitelisted = 10;
  optional Video video = 11;
  optional Picture picture = 12;
  optional google.protobuf.Timestamp created_at = 13;
  optional google.protobuf.Timestamp updated_at = 14;
  optional int64 version = 15;

  message Video {
    optional string id = 1;
    optional int64 content_id = 2;
    optional string moderation_status_code = 3;
    optional string transcoder_status_code = 4;
    optional string player_id = 5;
    optional string player_url = 6;
    optional int64 duration_ms = 7;
    optional int64 height = 8;
    optional int64 width = 9;
    optional google.protobuf.Timestamp created_at = 10;
    optional google.protobuf.Timestamp updated_at = 11;
  }
  message Picture {
    optional string id = 1;
    optional string name = 2;
    optional string namespace = 3;
    optional int64 group_id = 4;
    optional google.protobuf.Timestamp created_at = 5;
  }
}
enum EShotStatus {
  SHOT_STATUS_UNSPECIFIED = 0;
  SHOT_STATUS_PUBLISHED = 1;
  SHOT_STATUS_REJECTED = 2;
  SHOT_STATUS_ARCHIVED = 3;
}

